import PropTypes from "prop-types";
import "./NameEmailLabels.css";

const NameEmailLabels = ({ yourName, enterYourNamePlaceholder, propMinWidth, handleChange, name }) => {
  return (
    <div className="name-email-label" style={{ minWidth: propMinWidth }}>
      <label>{yourName}</label>
      <input
        type="text"
        placeholder={enterYourNamePlaceholder}
        onChange={handleChange}
        name={name}
      />
    </div>
  );
};

NameEmailLabels.propTypes = {
  yourName: PropTypes.string.isRequired,
  enterYourNamePlaceholder: PropTypes.string.isRequired,
  propMinWidth: PropTypes.string,
  handleChange: PropTypes.func.isRequired,
  name: PropTypes.string.isRequired,
};

export default NameEmailLabels;
